import PropTypes from 'prop-types';

function Images({src, alt}) {
    return (
        <div style={{width: '100%'}}>
        <img class="card-img-top" src={src} alt={alt} width="300px"
       // style={{ background: 'silver', color: '#ffffff', fontSize: "18px", whiteSpace: 'nowrap'}}
         /> 
        </div>
    )
}

Images.propTypes = {
    src: PropTypes.string,
    alt: PropTypes.string
}
export default Images;
